import React from "react";
import styled from "styled-components";

const Container = styled.div`
  height: auto;
  display: flex;
  justify-content: space-between;
  align-items: center;
  .left-box {
    display: flex;
    width: 40%;
    ul {
      display: flex;
      list-style: none;
      font-weight: bold;
    }
  }
`;

const MenuBar = () => {
  return (
    <Container>
      <div className="left-box">
        <ul className="menu">
          <li>Promotions</li>
          <li>Combos</li>
          <li>A la carte</li>
        </ul>
      </div>
      <div className="right-box"></div>
    </Container>
  );
};

export default MenuBar;
